import Card from '../../components/Card/'
import backend from '../../backend/logements'

function gallery (){

  return <>
  <Card
    key="bla"
    label="blo"
    picture= {backend[1].cover}
    title="job"
  />
  </>
}

function Accueil (){
  return <>
  <h1>backend</h1>

  <Link to="/Logement">Logement</Link>
  </>
}

export default Accueil;
